                                 'Get my Free Newsletter and Downloadable Cheatsheets (eating '
                                 'out, travel, etc): '
                                 'https://www.thomasdelauer.com/life-optimization-tactics/\n'
                                 '\n'
                                 'Follow More of My Daily Life on Instagram: '
                                 'http://www.Instagram.com/ThomasDeLauer\n'
                                 '\n'
                                 'This one is kind of personal to me. I lost my dad to cancer '
                                 'a few years back and since then I made it my mission to '
                                 'uncover what, and how, nutrition can help slow down the '
                                 "progression of cancer cells. This isn't made with "
                                 'disrespect towards the the medical field. If anything, this '
                                 'should go hand in hand with it.\n'
                                 '\n'
                                 'Note: Research is ongoing to see which types of cancer are '
                                 'prone to glucose restriction and which are not (for '
                                 'example, in a type of brain cancer called glioblastoma, '
                                 'cancerous glioma cells rely on glucose for survival and '
                                 'division)\n'
                                 '\n'
                                 'Cancer cells often times show increased glucose metabolism '
                                 'when compared with normal cells -\n'
                                 'in normal cells, the conversion of glucose to ATP requires '
                                 'oxygen, and when oxygen is absent, lactic acid is produced\n'
                                 '\n'
                                 'Cancer cells convert glucose to lactic acid in the presence '
                                 'of oxygen and need glucose for survival and division\n'
                                 '\n'
                                 'So if glucose restricted or inhibited, the energy source is '
                                 'switches to fats, or more specifically, ketones\n'
                                 '\n'
                                 'In a study published in Cell Reports (2019), researchers '
                                 'restricted glucose in mice with lung cancer - while the '
                                 'dietary restriction did not shrink certain tumors, it did '
                                 'stop them from progressing\n'
                                 '\n'
                                 'However, it did not affect other types of tumors (meaning '
                                 "this is cancer cell type specific and you can't generalize "
                                 'to all types of cancer)\n'
                                 '\n'
